-- CREATE
CREATE PROC [dbo].[spr_ETL_ComparatorClients_M3]
AS
BEGIN
	-- 0. Declare temp table
	DECLARE @editClients TABLE (CMR_ID VARCHAR(40))
	 
	-- 1. Extract raw data and parse it into flat table
	SELECT a.CMR_ID, a.FirstName, a.LastName, a.FullName, a.DOB, a.Title, a.BankAccountID, a.BankAccount, a.AccountName, a.AddressID, a.Street, a.PostalCode, a.OtherAddressInfo, a.Email, a.Mobile, a.OtherContactInfo, a.Created_date,
		(a.CMR_ID+'#'+ISNULL(a.FirstName,'')+'#'+ISNULL(a.LastName,'')+'#'+ISNULL(a.FullName,'')+'#'+ISNULL(CONVERT(VARCHAR(10),a.DOB),'')+'#'+ISNULL(a.Title,'')+'#'+ISNULL(CONVERT(VARCHAR(50), a.BankAccountID),'')+'#'+ISNULL(a.BankAccount,'')+'#'+ISNULL(a.AccountName,'')+'#'+ISNULL(CONVERT(VARCHAR(50),a.AddressID),'')+'#'+ISNULL(a.Street,'')+'#'+ISNULL(a.PostalCode,'')+'#'+ISNULL(a.OtherAddressInfo,'')+'#'+ISNULL(a.Email,'')+'#'+ISNULL(a.Mobile,'')+'#'+ISNULL(a.OtherContactInfo,'')) AS Hashkeys
	INTO #comparatorClients
	FROM 
	(
		SELECT CM.CMR_ID, CT.CTI_FirstName AS FirstName, 
		(CASE WHEN CT.CTI_MiddleName IS NULL 
			THEN CT.CTI_Surname 
			ELSE (CT.CTI_Surname + ' ' + CT.CTI_MiddleName) 
		END) AS LastName,
		(CASE CCT.XCTi_Detail
			WHEN 'Mr' THEN LOWER(ISNULL(REPLACE(CT.CTI_FirstName,' ',''),'') + ' ' + ISNULL(REPLACE(CT.CTI_Surname,' ',''),'') + ' ' + ISNULL(REPLACE(CT.CTI_MiddleName,' ',''),''))
			ELSE LOWER(ISNULL(REPLACE(CT.CTI_FirstName,' ',''),'') + ' ' + ISNULL(REPLACE(CT.CTI_MiddleName,' ',''),''))
		END) AS FullName, CONVERT(DATE,CT.CTI_DOB) AS DOB,
		CCT.XCTi_Detail AS 'Title', 
		-- Bank Account Info
		CB.CBD_ID AS BankAccountID, (ISNULL(CB.CBD_BankName,'') + '-' + CB.CBD_AccountNumber) AS BankAccount, REPLACE(LOWER(CB.CBD_AccountName),' ','') AS AccountName,
		-- Address Infor
		CA.CAD_ID AS AddressID, REPLACE(LOWER(ISNULL(CA.CAD_StreetNumber,'') + ISNULL(CA.CAD_StreetName,'')),' ','') AS Street, CA.CAD_PostCode AS PostalCode, (ISNULL(CA.CAD_City,'') + '-' + ISNULL(CA.CAD_State,'')) AS OtherAddressInfo,
		-- Contact Infor
		CCD_Email.Email, CCD_Mobile.Mobile,'' AS OtherContactInfo,
		-- Timestamp
		GETDATE() AS Created_date
		FROM iO_Client_MASterReference CM 
			JOIN iO_Client_TypeIndividual CT ON CM.CMR_ID = CT.CTI_IDLink_CMR
			LEFT JOIN iO_Control_ClientTitle CCT WITH (NOLOCK) ON CCT.XCTi_ID = CT.CTI_IDLink_XCT
			LEFT JOIN iO_Control_ClientGender CG WITH (NOLOCK) ON CG.XCGn_ID = CT.CTI_IDLink_XCGn
			LEFT JOIN iO_Client_BankDetail CB ON CM.CMR_ID = CB.CBD_IDLink_CMR
			LEFT JOIN (SELECT CCD_IDLink_CMR, CCD_Details AS Email FROM iO_Client_ContactDetail WHERE CCD_IDLink_XCT = '{f8d0cbcc-ad81-4ed2-a4eb-ec39ac35168c}') CCD_Email ON CM.CMR_ID = CCD_Email.CCD_IDLink_CMR
			LEFT JOIN (SELECT CCD_IDLink_CMR, CCD_Details AS Mobile FROM iO_Client_ContactDetail WHERE CCD_IDLink_XCT = '{29411831-e939-4357-940a-44f55b4a5c9b}' ) CCD_Mobile ON CM.CMR_ID = CCD_Mobile.CCD_IDLink_CMR
			LEFT JOIN [iO_Client_AddressDetail ] CA ON CM.CMR_ID = CA.CAD_IDLink_CMR
		WHERE CM.CMR_ID IN ('{3c94c022-6963-49f2-85d0-2232e46e2a63}','{25a5935b-5bf3-4ed9-9836-89810b9f321f}','{a80aa1ff-64b0-4b73-870e-ebf7b87ea474}','{4f712d62-e13d-46eb-8ea5-1a0005fc8cab}','{86dba470-478b-447d-ba66-6c4133201f74}','{81986fa2-7374-40fd-b1b6-640f7918de37}','{4c1e54a3-4b9f-438d-9688-14dd9d2776ae}','{644f3a8e-e996-4a4c-865c-364de21d0d98}','{79fb8d81-8d4d-4566-81ae-0f09400b6794}','{02c0a7b3-08e8-499f-977c-d8584068c4bc}','{119974b9-19e9-42bf-8180-5b829241a5a2}','{63ef50e0-1735-4fd3-9b59-a2fbd4c92ea5}','{4bf33824-f50e-43a0-8772-8c74f44aa076}','{ae73aca0-d1c8-4787-bcc4-516b04ccfdbd}','{eece65b7-a0e3-4a6b-8ba3-057d84f5a7a7}','{c6d173e0-9862-480e-bf55-f1097fe3ac19}','{6670d98f-f8fd-4169-b378-21af1b178b40}','{6e707169-38e6-4e6c-8ddb-50f1764985e6}','{4ed7a1a0-748c-4ea7-ba88-2a6c3aa07314}','{96bec539-6dcd-43a6-8f1d-9f8f3eb3dce1}','{3766636f-7e64-491c-8700-689bb1dd17de}','{45bf9024-e989-41a8-ac05-d49da58f87bb}','{1d29f5f2-cc5c-4a99-95b5-763b9e137117}','{f9d69c51-4a58-42ef-86f7-4a28d5b4785b}','{fc25daa5-5aac-4d12-bb5c-ca14bf60b539}','{5a2d2bca-00df-4807-a77a-ecf55794083f}','{421ed085-287a-4199-84dc-98dd25561148}','{d4c0d052-dd59-44f3-a52c-c788a9c4ab51}','{d421e508-ff9c-4a29-9d0d-3f3d2e62ce1c}','{8dc2ca1f-1742-40b8-9fbb-f50840fb2638}','{4e9715fe-b2d4-4813-a571-6c586ed8d135}','{5c217585-f500-4229-b4b6-292ef378081d}','{c7fc6a02-25a3-4d6b-8867-3232b9bb2264}','{f2c9eb0f-388a-4a1f-bd05-25986366b3af}','{126bb418-1783-4a30-ae33-21e6e80beebc}','{1a6aa109-83bb-4588-93d9-705862a72c39}','{c65fa27e-77f5-40ee-a076-ac1f027ff729}','{4944f882-e4a0-4148-8df6-c40e9643dc6c}','{f72449a4-50e1-4a5f-9be5-c8db42e453fb}','{aff812a4-6c7d-46cb-ad83-a86d5433f751}','{fb616782-0157-46c2-954c-2653194a6b31}','{d8c5bdc6-cb20-43cd-be84-c8f412fb36ee}','{65b22080-ebef-4a3b-a69c-73ba1d690400}','{299f9e45-9ca8-4006-8cf2-c1c48fa490bd}','{f56936fc-32c0-4699-a2f5-c62a610e8e3f}','{78f21c4f-33ce-4b5c-8fe6-4b6bbf56b23f}','{01b4e644-1de8-4881-bb61-89f1be961abd}','{20402884-a072-476a-adc2-2319321892bc}','{17d8139e